import React, { useState } from "react";
import { User, LogOut, X, Menu } from "react-feather";

const Navbar = ({ user, onSignOut, activeTab, setActiveTab }) => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  return (
    <nav className="bg-blue-600 text-white shadow-lg">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          <div className="flex items-center">
            <h1 className="text-xl font-bold">CampusSphere</h1>
          </div>
          
          {/* Desktop Menu */}
          <div className="hidden md:flex items-center space-x-4">
            <button
              onClick={() => setActiveTab('events')}
              className={`px-3 py-2 rounded-md text-sm font-medium ${
                activeTab === 'events' ? 'bg-blue-800' : 'hover:bg-blue-700'
              }`}
            >
              Events
            </button>
            <button
              onClick={() => setActiveTab('chat')}
              className={`px-3 py-2 rounded-md text-sm font-medium ${
                activeTab === 'chat' ? 'bg-blue-800' : 'hover:bg-blue-700'
              }`}
            >
              AI Assistant
            </button>
            {user?.email.includes('teacher') && (
              <button
                onClick={() => setActiveTab('dashboard')}
                className={`px-3 py-2 rounded-md text-sm font-medium ${
                  activeTab === 'dashboard' ? 'bg-blue-800' : 'hover:bg-blue-700'
                }`}
              >
                Dashboard
              </button>
            )}
            <div className="flex items-center space-x-2">
              <User className="w-5 h-5" />
              <span className="text-sm">{user?.displayName}</span>
              <button
                onClick={onSignOut}
                className="ml-2 p-1 hover:bg-blue-700 rounded"
              >
                <LogOut className="w-4 h-4" />
              </button>
            </div>
          </div>

          {/* Mobile menu button */}
          <div className="md:hidden">
            <button
              onClick={() => setIsMenuOpen(!isMenuOpen)}
              className="p-2 hover:bg-blue-700 rounded"
            >
              {isMenuOpen ? <X className="w-5 h-5" /> : <Menu className="w-5 h-5" />}
            </button>
          </div>
        </div>
      </div>

      {/* Mobile Menu */}
      {isMenuOpen && (
        <div className="md:hidden bg-blue-700">
          <div className="px-2 pt-2 pb-3 space-y-1">
            <button
              onClick={() => { setActiveTab('events'); setIsMenuOpen(false); }}
              className={`block w-full text-left px-3 py-2 rounded-md text-base font-medium ${
                activeTab === 'events' ? 'bg-blue-800' : 'hover:bg-blue-600'
              }`}
            >
              Events
            </button>
            <button
              onClick={() => { setActiveTab('chat'); setIsMenuOpen(false); }}
              className={`block w-full text-left px-3 py-2 rounded-md text-base font-medium ${
                activeTab === 'chat' ? 'bg-blue-800' : 'hover:bg-blue-600'
              }`}
            >
              AI Assistant
            </button>
            {user?.email.includes('teacher') && (
              <button
                onClick={() => { setActiveTab('dashboard'); setIsMenuOpen(false); }}
                className={`block w-full text-left px-3 py-2 rounded-md text-base font-medium ${
                  activeTab === 'dashboard' ? 'bg-blue-800' : 'hover:bg-blue-600'
                }`}
              >
                Dashboard
              </button>
            )}
            <div className="px-3 py-2 text-sm">
              <div className="flex items-center space-x-2">
                <User className="w-4 h-4" />
                <span>{user?.displayName}</span>
              </div>
              <button
                onClick={onSignOut}
                className="mt-2 flex items-center space-x-2 text-red-200 hover:text-red-100"
              >
                <LogOut className="w-4 h-4" />
                <span>Sign Out</span>
              </button>
            </div>
          </div>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
